/*!50001 VIEW `ca_marks` AS select `q`.`reg_no` AS `reg_no`,`q`.`course_code` AS `course_code`,((coalesce(`q`.`total_quiz_marks`,0) + coalesce(`a`.`total_assessment_marks`,0)) + coalesce(`m`.`total_mid_marks`,0)) AS `ca_marks` from ((`tot_quiz_marks` `q` left join `tot_assessment_marks` `a` on(((`q`.`reg_no` = `a`.`reg_no`) and (`q`.`course_code` = `a`.`course_code`)))) left join `tot_mid_marks` `m` on(((`q`.`reg_no` = `m`.`reg_no`) and (`q`.`course_code` = `m`.`course_code`)))) */;
